function y0 = init(a, b,  q_inf)

N=24;
Gamma_inf = -0.8;
D0        = 1.9;
D1        = -1.1;
D2        = 0;
zeta1     = 1.1;
mu1       = 0.05;
epsilon   = 0.05; 
ZS        = 0;
gamma1    = 5/3;
lambdan   = 1.25;
lambdaT   = 1.5;
cn        = 1.1;
cT        = 0.9;



L = 10;
Zguess = 1;

h = makeGrid(N, L, 3, 1e-5);
x = cumsum(h);

Tinf = (gamma1 - 1)* q_inf / Gamma_inf;
T0 = Tinf / (1 + lambdan / (lambdaT * zeta1));
cg = (zeta1*cT - cn) / (1 + zeta1 * lambdaT/lambdan);

D   = @(z) D0 + D1*tanh(z) + D2 * (tanh(z)).^2;
G   = @(z) a - b*(z - ZS) - (z - ZS).^3;
