Dt = [Dt3, Dt2, Dt1, Dt0];
DT = De * Ge * Dt;
GT = [-1 0 -b a];
p = GT - DT;

r = roots(p);
r = sort(r);

if ~isreal(r)
    ZL = fzero(G, -1);
    Z = ZL * ones(1, length(x));
else

ZL = r(1);
ind = find(abs(r - Z0) == min(abs(r - Z0)));
if ind == 1
    Z = ZL * ones(1, length(x));
else
    if ind == 2
        Z2 = r(2);
        Z3 = r(3);
